import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import HomePage from "containers/HomePage";
const index = () => {
  return (
    <>
      <Router>
        <Switch>
          <Route>
            <HomePage />
          </Route>
        </Switch>
      </Router>
    </>
  );
};
export default index;
